import { Typography } from "@material-ui/core";
import React from "react";

function FormErrorText(errors) {
  console.log(errors);
  return (
    <>
      {/* {errors.map((error) => {
        <Typography variant="caption" color="textSecondary">
          {error.msg}
        </Typography>;
      })} */}
    </>
  );
}

export default FormErrorText;
